import Card from 'react-bootstrap/Card'
import Button from 'react-bootstrap/Button'
import { ListGroup } from 'react-bootstrap'
import { useState } from 'react'
import Modal from 'react-bootstrap/Modal'
import classes from './Work.module.css'
// import ModalBody from 'react-bootstrap/ModalBody'
// import ModalFooter from 'react-bootstrap/ModalFooter'
// import ModalTitle from 'react-bootstrap/ModalTitle'
// import ModalHeader from 'react-bootstrap/ModalHeader'

const Work = () => {
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <>
      <Card style={{ margin: 'auto', marginTop: '20px', width: '400px', height: '300px' }} bg="light" border="light" text="black" className="text-center">
        <Card.Body>
          <Card.Title>Work Experience</Card.Title>
          <Card.Text>
            <ListGroup>
              <ListGroup.Item action variant="dark" onClick={handleShow}>HP</ListGroup.Item>
              <ListGroup.Item action variant="dark">HP Enterprise</ListGroup.Item>
              <ListGroup.Item action variant="dark">IBM</ListGroup.Item>
            </ListGroup>
          </Card.Text>
          {/* <Button href="/" variant="primary">Home</Button> */}
        </Card.Body>
      </Card >
      <Modal show={show} onHide={handleClose} centered={true} >
        <Modal.Header>
          <div className={classes.modalHPtitle}>
            <h3>HP</h3>
          </div>
        </Modal.Header>
        <Modal.Body className="text-center"><p><b>Program Coordinator - Worlwide Commercial Notebooks</b> <p></p><p>Mainly in charge of Bill Of Material for Sustaining and New Product Introductions</p></p></Modal.Body>
        <Modal.Footer>
          <Button variant="danger" size="sm" onClick={handleClose} style={{ margin: 'auto' }}>
            Close
          </Button>
        </Modal.Footer>
      </Modal>
    </>
  );
}

export default Work;
